(2, 1, 1, 2, '8997035563544', 'Pocari sweat PET 350ml', 'Pocari Sweat 350ml', 'Minuman Isotonik sebagai pengganti cairan dan ion tubuh yang hilang setiap harinya.', '5950.00', 1, '5600.00', 1, 0, '/penampakan/images/php/files/8997035563544-Pocari-Sweat-350ml-a%20%281%29.jpg', 'Dus/Box', 0, '0.00'),
