(5, 1, 6, 7, '8991003065061', 'Huki cotton bud Zak standard 100S', 'Huki Ctnbud ZS 100', 'Cotton Bud Baby HUKI dikemas dalam plastik untuk menjaga agar tetap higienis dalam penyimpanan dan mudah untuk dibawa. Dirancang khusus untuk membersihkan telinga, hidung dan pusar bayi dengan baik serta aman karena kapas tidak akan tertinggal. Terbuat dari 100% kapas alam, tidak mengandung merkuri dan OBA atau bahan pemutih.', '5200.00', 1, '4200.00', 24, 0, '/penampakan/images/php/files/8991003065061-huki-cotton-bud-zak-std-100S-c%20%283%29.jpg', 'Dus/Box', 0, '0.00'),
(6, 1, 6, 7, '8991003065023', 'Huki cotton bud pot 100S', 'Huki Ctnbud Pot 100S', 'Cotton Bud Baby HUKI dikemas dalam plastik berbentuk pot sehingga mudah diatur di dalam ruangan. Dirancang khusus untuk membersihkan telinga, hidung dan pusar bayi dengan baik serta aman karena kapas tidak akan tertinggal. Terbuat dari 100% kapas alam, tidak mengandung merkuri dan OBA atau bahan pemutih.', '7600.00', 1, '5700.00', 12, 0, '', 'Dus/Box', 0, '0.00'),
(7, 1, 6, 7, '8997050803212', 'Huki cotton bud extra safe 63S', 'Huki Ctnbud Xtra 63S', 'Bersihkan telinga si kecil dari kotoran dengan menggunakan HUKI Cotton Buds Box 63&#039;S (Extra Safe) yang berukuran kecil khusus digunakan untuk telinga buah hati Anda.', '15200.00', 0, '0.00', 11, 0, '', 'Dus/Box', 0, '0.00'),
(8, 1, 8, 9, '8994122398126', 'Santan Cocomas 200 ml', 'Cocomas Santan 200ml', 'Merupakan santan asli yang terbuat dari kelapa segar dan diolah menggunakan teknologi modern sehingga terjaga keaslian dan kebersihannya. Dengan kemasan kotak yang praktis memudahkan Anda memasak berbagai sajian hidangan istimewa.', '10000.00', 0, '0.00', 25, 0, '/penampakan/images/php/files/8994122398126-Cocomas-c.jpg', 'Dus/Box', 0, '0.00'),
(9, 1, 3, 4, '8993039111255', 'Regal Marie biscuit (kecil) 125gr', 'Regal Marie 125gr', 'Kemasan yang paling dikenal oleh penggemar biskuit Marie Regal, dengan isi 17 keping dan 125gr', '10100.00', 0, '0.00', 12, 0, '/penampakan/images/php/files/8993039111255-marie-regal.jpg', 'Dus/Box', 0, '0.00'),
(10, 1, 3, 4, '8993039112511', 'Regal Marie biscuit Spesial (besar) 250gr', 'Regal Marie Sp 250gr', 'Apa artinya Spesial? Untuk penggemar biskuit Marie Regal dengan cita rasa susu dan mentega yang lebih banyak. Aroma susu dan mentega yang tidak bisa dilawan oleh produk lain.', '22000.00', 0, '0.00', 12, 0, '/penampakan/images/php/files/8993039112511-Regal-Marie-special-a.jpg', 'Dus/Box', 0, '0.00'),
(11, 1, 3, 4, '8993039242539', 'Regal marie duo coklat 125gr', 'Regal Marie Du 125gr', 'Biskuit sandwich dengan biskuit Marie Regal yang dikenal, dengan krim coklat yang terbuat oleh mentega dan bubuk kakao. Krim coklatnya tidak terlalu manis dan rasa coklat membbuat tambahan cita rasa dari biskuit Marie Regal.', '7550.00', 1, '5800.00', 12, 0, '/penampakan/images/php/files/8993039242539-Marie-Duo-a.jpg', 'Dus/Box', 0, '0.00'),
(12, 1, 24, 25, '8992772265164', 'Antis hand sanitizer btl spray 55ml jeruk nipis', 'Antis spr Jrk 55ml', 'Pembersih tangan anti kuman aroma jeruk nipis tanpa air berbasis alkohol yang efektif membunuh kuman dengan cepat, seperti kuman flu dan diare, dan juga praktis untuk digunakan dimana saja dan kapan saja.', '13750.00', 0, '0.00', 12, 0, '/penampakan/images/php/files/8992772265164-Antis-Hs-spray-jeruk-nipis-a.jpg', 'Dus/Box', 0, '0.00'),
(13, 1, 24, 25, '8992772265010', 'Antis hand sanitizer btl spray 55ml timun', 'Antis spr Tmn 55ml', 'Pembersih tangan anti kuman aroma timun tanpa air berbasis alkohol yang efektif membunuh kuman dengan cepat, seperti kuman flu dan diare, dan juga praktis untuk digunakan dimana saja dan kapan saja.', '13750.00', 0, '0.00', 12, 0, '/penampakan/images/php/files/8992772265010-Antis-Hs-spray-timun-a.jpg', 'Dus/Box', 0, '0.00'),
(14, 1, 24, 26, '8992772215015', 'Soffel btl 80gr Bunga Geranium', 'Soffel btl Ger 80gr', 'Penolak nyamuk berbentuk lotion aroma bunga geranium. Soffell melindungi tubuh dari gigitan nyamuk dengan efektifitas mencapai 8 jam dengan moisturizer sehingga kulit tetap lembut, tidak panas dan tidak lengket.', '10950.00', 0, '0.00', 12, 0, '/penampakan/images/php/files/8992772215015-Soffel-Bunga-Geranium-a.jpg', 'Dus/Box', 0, '0.00'),
(16, 1, 24, 26, '8992772315128', 'Soffel btl 80gr Kulit Jeruk', 'Soffel btl Jrk 80gr', 'Penolak nyamuk berbentuk lotion aroma kulit jeruk. Soffell melindungi tubuh dari gigitan nyamuk dengan efektifitas mencapai 8 jam dengan moisturizer sehingga kulit tetap lembut, tidak panas dan tidak lengket.', '11950.00', 0, '0.00', 12, 0, '/penampakan/images/php/files/8992772315128-Soffel-Kulit-Jeruk-a.jpg', 'Dus/Box', 0, '0.00'),
(17, 1, 24, 26, '8992772035125', 'Soffel btl 80gr Apel', 'Soffel btl Apl 80gr', 'Penolak nyamuk berbentuk lotion aroma apel. Soffell melindungi tubuh dari gigitan nyamuk dengan efektifitas mencapai 8 jam dengan moisturizer sehingga kulit tetap lembut, tidak panas dan tidak lengket.', '11950.00', 0, '0.00', 12, 0, '/penampakan/images/php/files/8992772035125-Soffel-apel-a.jpg', 'Dus/Box', 0, '0.00'),
(18, 1, 24, 26, '8992772215039', 'Soffel spray 80ml bunga geranium', 'Soffel spr Ger 80ml', 'Penolak nyamuk berbentuk spray aroma bunga geranium. Soffell melindungi tubuh dari gigitan nyamuk dengan efektifitas mencapai 8 jam dengan moisturizer sehingga kulit tetap lembut, tidak panas dan tidak lengket.', '13650.00', 0, '0.00', 12, 0, '/penampakan/images/php/files/8992772215039-Soffel-spray-geranium-a.jpg', 'Dus/Box', 0, '0.00'),
